"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[651],{1651:function(i,e,a){a.r(e),e.default={page_sections:{home:{slogan:{main:"Nowy poziom innowacyjności w",item_1:"aplikacjach webowych",item_2:"systemach wbudowanych",item_3:"grach wideo"}},about_us:{title:"O nas",subsection_1:{title:"Misja",subtitle:"Wspieranie innowacji",text:"Promujemy innowacje i wzmacniamy jednostki oraz przedsiębiorstwa za pomocą zaawansowanych technologii.\nNasza oferta obejmuje portfolio innowacyjnych produkt\xf3w, kt\xf3re znajdują odzwierciedlenie w potrzebach rynku.\nPonadto, dostarczamy spersonalizowane rozwiązania skrojone na miarę specyficznych wymagań naszych klient\xf3w.\nJako zaufani doradcy, wykorzystujemy naszą wsp\xf3lną wiedzę i doświadczenie, w wspieraniu naszych klient\xf3w w znajdywaniu optymalnych rozwiązań technologicznych,\nco zapewnia im przewagę w dynamicznie ewoluującym środowisku. Nasze zaangażowanie wykracza jednak poza aspekty komercyjne.\nJako entuzjaści otwartego oprogramowania, jesteśmy przekonani o sile wsp\xf3łdzielenia i wsp\xf3łpracy.\nAktywnie angażujemy się w projekty open-source, tym samym szerząc dostęp do bogatych zasob\xf3w i wiedzy, co umożliwia szeroką wsp\xf3łpracę i innowacyjność na globalną skalę.\n"},subsection_2:{title:"Zesp\xf3ł",subtitle:"Wiele talent\xf3w, wsp\xf3lna wizja",text_1:"Jesteśmy grupą wykwalifikowanych specjalist\xf3w z wielu dziedzin informatyki,\nkt\xf3rych łączy wsp\xf3lna pasja do eksploracji, eksperymentowania i pionierskiego podejścia przy tworzeniu rozwiązań.\nWyr\xf3żniamy się bogatym wachlarzem doświadczeń i kompetencji technicznych, kt\xf3re wsp\xf3lnie rozwijamy.\nPosiadamy wszechstronne specjalizacje, począwszy od tworzenia aplikacji internetowych i gier komputerowych, przez sztuczną inteligencję, aż po telekomunikację.\n",text_2:"R\xf3żnorodność specjalizacji umożliwia nam efektywne rozwiązywanie wielorakich wyzwań technologicznych.\nOsiągnięcia akademickie w prestiżowych uczelniach, takich jak University College London, KTH w Sztokholmie oraz na Politechnice Warszawskiej są dowodem na nasz nacisk na rozw\xf3j.\nWsp\xf3lnie dążymy do tworzenia wyjątkowych i wysokiej jakości rozwiązań, kt\xf3re przynoszą realne korzyści i inspirują do dalszych poszukiwań.\nNasz zesp\xf3ł to połączenie głębokiego szacunku do wiedzy z nieustanną chęcią tworzenia nowych, ekscytujących technologii.\n"}},projects:{title:"Projekty",subsection_1:{title:"Miejska Mapa Wydarzeń",subtitle:"Rozw\xf3j miast przyszłości",text:"Miejska Mapa Wydarzeń to innowacyjna platforma cyfrowa, dostępna zar\xf3wno w formie aplikacji internetowej, jak i mobilnej, stworzona z myślą o podniesieniu jakości życia mieszkańc\xf3w miast.\nKonsoliduje informacje o lokalnych wydarzeniach kulturalnych, utrudnieniach drogowych, przerwach w dostawie usług, zagrożeniach i innych istotnych zdarzeniach w mieście.\nUmożliwia to nie tylko łatwiejsze planowanie codziennego życia dzięki prostemu dostępowi do wszystkich informacji,\nale także redukuje nieporozumienia i pomaga w orientacji w bogatej ofercie wydarzeń miejskich, zwiększając tym samym ich widoczność.\nMiejska Mapa Wydarzeń pełni r\xf3wnież funkcję kluczowego kanału komunikacji między władzami miasta a jego mieszkańcami,\npromując transparentność i efektywność w przekazywaniu informacji w ramach społeczności.\n"},subsection_2:{title:"Sticky Web Platform",subtitle:"Tworzenie aplikacji w trybie turbo",text:"Sticky Web Platform (SWP) to przełomowy framework open-source zaprojektowany w celu usprawnienia tworzenia aplikacji internetowych.\nZintegrowany w formie gotowego do użytku stosu kontener\xf3w Docker, SWP znacząco skraca czas potrzebny do stworzenia i konfiguracji aplikacji webowej – z dni do zaledwie kilku minut.\nJego wyjątkowa funkcjonalność tkwi w umożliwieniu dynamicznego definiowania kluczowych element\xf3w systemu poprzez pojedynczy plik konfiguracyjny w formacie tekstowym,\ntym samymm otwieracjąc drzwi do programowania tego typu system\xf3w także osobom nieposiadającym eksperckiej wiedzy w tym zakresie.\n"},subsection_3:{title:"Synthetica.art",subtitle:"Nowy poziom sztuki cyfrowej",text:"Synthetica.Art to nowatorska platforma oparta na sztucznej inteligencji, zaprojektowana z myślą o ułatwieniu tworzenia grafiki do gier wideo i film\xf3w.\nDostosowana do specyficznych potrzeb deweloper\xf3w, znacząco przyspiesza proces produkcji dzięki możliwości efektywnego generowania wysokiej jakości materiał\xf3w dzięki AI.\nSynthetica.Art optymalizuje czasochłonne procesy tworzenia asset\xf3w, co umożliwia tw\xf3rcom skupienie się na rozwijaniu angażujących i innowacyjnych doświadczeń.\nPonadto, Synthetica.Art demokratyzuje proces tw\xf3rczy, umożliwiając deweloperom na wszelkich poziomach zaawansowania tworzenie wizualnie i technicznie złożonych dzieł,\neliminując potrzebę posiadania rozwinietych umiejętności artystycznych.\n"}},activity:{title:"Aktywność",subsection_1:{title:"Hackathony i game jamy",subtitle:"Zwycięstwo na HackYeah 2022",text:"Można nas spotkać na r\xf3żnych hackathonach i game jamach, w kt\xf3rych regularnie uczestniczymy.\nWwydarzenia te są dla nas źr\xf3dłem energii, inspiracji i pasji, zaś nasze sukcesy obfitują w zwycięstwa i miejsca na podium.\nWyr\xf3żnianiamy się w środowiskach wymagających zar\xf3wno konkurencyjności, jak i kreatywności,\na także umiejętność osiągania niepowtarzalnych rezultat\xf3w w pod presją czasu.\n"},subsection_2:{title:"Wykłady i konferencje",subtitle:"Wykład na konferencji LF Energy Embedded Summit 2023",text:"SPS to nie tylko innowatorzy - jesteśmy r\xf3wnież gorącymi zwolennikami dzielenia się naszą wiedzą i doświadczeniem.\nWystępujemy na scenach prestiżowych konferencji, takich jak FOSDEM, GDC oraz GIC,\ngdzie dzielimy się naszymi spostrzeżeniami, doświadczeniami i perspektywami. Skupiamy się na otwartej wymianie wiedzy i kontakt\xf3w,\nco jest kluczowe dla innowacji w dynamicznie zmieniających się branżach technologicznych.\n"},subsection_3:{title:"Wkład w otwarte oprogramowanie",subtitle:"Uczestnictwo w konferencji Embedded Open Source 2023",text:"Naszym priorytetem jest aktywne angażowanie się w społeczność open-source - dlatego z dumą rozwijamy Sticky Web Platform – nasz flagowy projekt.\nJest on wyrazem naszego zobowiązania się do tworzenia technologii, kt\xf3re są zar\xf3wno og\xf3lnodostępne, jak i zaawansowane, służąc przyczyniając się do polepszenia dobrowytu całej społeczności.\n"}},collaboration:{title:"Wsp\xf3łpraca",subsection_1:{text_1:"Jesteśmy otwarci na wsp\xf3łpracę. Wierzymy, że wielkie pomysły wymagają połączenia sił zdolnych os\xf3b\ni dostrzegamy wielki potencjał w wymianie doświadczeń i przemyśleń. Jesteśmy przekonani, że wsp\xf3lnie możemy osiągnąć znacznie więcej!\nNasze drzwi są zawsze otwarte na nowe pomysły i projekty, kt\xf3re mają szansę zmienić oblicze świata.\n",text_2:"Niezależnie od tego, czy jesteś entuzjastą technologii, wizjonerskim przedsiębiorstwem, czy kreatywną osobą z genialnym pomysłem,\nchętnie porozmawiamy o opcjach wsp\xf3łpracy. Jeśli chcesz zaproponować wsp\xf3lny projekt, podzielić się przemyśleniami, czy po prostu nawiązać kontakt, napisz do nas.\n"}},contact:{title:"Kontakt",subsection_1:{title:"Pozostańmy w kontakcie!",text:"Masz pytania, propozycje, lub chciałbyś porozmawiać o potencjalnej wsp\xf3łpracy?\nZapraszamy do kontaktu drogą mailową lub poprzez LinkedIn. Czekamy z niecierpliwością na Twoją wiadomość!\n"}}}}}}]);